Это значит, что почти для каждого народа правительство было вынуждено создать особые условия в экономике, налогах и управлении.

Например:
* немецких колонистов полностью освободили от налогов государству и других обязанностей;
* евреям запретили жить за пределами определённых территорий;
* украинцы и белорусы, которые жили на территории бывшей Речи Посполитой, сначала вообще не платили подушный налог, а потом платили его наполовину.
